import { defineStore } from 'pinia'
import axios from 'axios'

export const useShopStore = defineStore({
  id: 'shop',

  state: () => ({
    products: [],
    cart: [],
  }),

  actions: {
    async fetchProducts() {
      try {
        const response = await axios.get(
          'https://script.googleusercontent.com/macros/echo?user_content_key=tpmdXxfRIetf3L7LHwcb7_R8Ir-j4O0JZM7hXRvqCR69vJMU-ah7EUB0phIJpYNY5EKolNnPsEsEYbFL-2J_evH8GKaYQyLsm5_BxDlH2jW0nuo2oDemN9CCS2h10ox_1xSncGQajx_ryfhECjZEnK4jwdgwZpo7gx_qVnURw9R5JFnetyDRT0j1vZkq91aylQdCZZjHUQaoRM1HWPX5NcE1Fr3LGjCqbMVgMdOpVtqaJbRBv9gJFtz9Jw9Md8uu&lib=Mtn_vs8cSZ0a4v_3WWGjVuMZHbvKLxQr5');
        this.products = response.data
      } catch (error) {
        console.error(error)
      }
    },

    addToCart(product) {
      this.cart.push(product)
    },
  },
})
